import React from 'react';
import './App.css';
import Input from './components/UserLogic/NewUser/Input';
import PopUpWin from './components/UI/PopUpWin/PopUpWin';

const UserArray=[];

function App(props) {
  const AddNewUser=(props)=>{
    UserArray.push(props.data);
  }


  return (
    <div>
      <Input userAdd={AddNewUser}/>    
      {false? <PopUpWin  title={"Wrong input"} 
      content={"You must enter the correct input.."} buttonName={"Close"}/> :""}
    </div>
  );
}

export default App;
